SalesDate_Quarter_1.query:
q = load "${App.Datasets.Sales_Data3_tp.FullyQualifiedName}";
tq = filter q by date('SalesDate_Year', 'SalesDate_Month', 'SalesDate_Day') in ["current quarter".."current quarter"];
lyq = filter q by date('SalesDate_Year', 'SalesDate_Month', 'SalesDate_Day') in ["4 quarters ago".."4 quarters ago"];
co = group tq by 'all', lyq by 'all';
co = foreach co generate sum(tq.'Amount') as 'tq_Amount', sum(lyq.'Amount') as 'lyq_Amount', sum(tq.'SALES_UNITS') as 'tq_SALES_UNITS', sum(lyq.'SALES_UNITS') as 'lyq_SALES_UNITS';

co = foreach co generate 'tq_Amount' as 'tq_Amount', 'lyq_Amount' as 'lyq_Amount', tq_SALES_UNITS as tq_SALES_UNITS, lyq_SALES_UNITS as lyq_SALES_UNITS, ('tq_Amount' / 'lyq_Amount') - 1 as 'YTD_Growth';

co = foreach co generate 'tq_Amount' as 'tq_Amount', 'lyq_Amount' as 'lyq_Amount', 'YTD_Growth' as 'YTD_Growth', tq_SALES_UNITS as tq_SALES_UNITS, lyq_SALES_UNITS as lyq_SALES_UNITS, case when ('YTD_Growth' < 0) then "🔽" else "🔼" end as 'Arrow_YTD_Growth';

