SAQL_UNITS_POINTS.query:
q = load "${App.Datasets.Sales_Data3_tp.FullyQualifiedName}";
q = filter q by date('SalesDate_Year', 'SalesDate_Month', 'SalesDate_Day') in ["1 quarter ago".."1 quarter ago"];
q = group q by 'Account_SALES_REP';
q = foreach q generate 'Account_SALES_REP' as 'Account_SALES_REP', sum('SALES_UNITS') as 'sum_SALES_UNITS';
q = group q by 'all';
q = foreach q generate avg('sum_SALES_UNITS') as 'avg_SALES_UNITS', min('sum_SALES_UNITS') as 'min_SALES_UNITS', max('sum_SALES_UNITS') as 'max_SALES_UNITS',avg('sum_SALES_UNITS') * 1.3 as 'high_SALES_UNITS', avg('sum_SALES_UNITS') * 0.7 as 'low_SALES_UNITS';

