lens_2.query:
q = load "${App.Datasets.Sales_Data3_tp.FullyQualifiedName}";
q = filter q by date('SalesDate_Year', 'SalesDate_Month', 'SalesDate_Day') in ["current year".."1 year ahead"];
q = group q by 'Product_SALESGROUP';
q = foreach q generate 'Product_SALESGROUP' as 'Product_SALESGROUP', first('Product_ProductPhotoUrl') as 'first_Product_ProductPhotoUrl', sum('Amount') as 'sum_Amount';
q = order q by 'sum_Amount' desc;
